window.bookSummaryJSON = "<p>Jimmy, Hayley, MJ, and Katarina have returned to school, but their lives have changed irrevocably with the discovery of Jimmy's true identity as the dream child of the Breamstone Collective. Yet many questions remain unresolved.</p> <p>The search for answers sends them deeper into Jimmy's dream world and further into his past in an attempt to unravel the plots of the demons behind the collective. Purple-haired goth girl Morrigan may be the keyâ€”or she may be the one to lead them further into the darkness.</p> <p>As the greatest powers of Hell finally take notice of Jimmy's existence, he discovers the chance to change everything, if he can only reach the solution in time.</p> <p>Contains mature themes.</p>"; 
